#CARGADO DE LAS TABLAS QUE FORMAN PARTE DEL MERE
#En nuestro caso, en vez de usar una bbdd como tal, cargaremos nuestros ficheros
#desde archivos excel

peliculas = pd.read_excel('https://raw.githubusercontent.com/ABP21-22/Proyecto/main/data/peliculas_2.xlsx')
peliculas

actores = pd.read_excel('https://raw.githubusercontent.com/ABP21-22/Proyecto/main/data/actores_2.xlsx')

actores

#AÑADIR A PELICULAS LA COLUMNA DE PALABRAS CLAVE DE LA SINOPSIS

from nltk.tokenize import word_tokenize
from nltk.corpus import stopwords
from nltk.stem import PorterStemmer

import nltk
nltk.download('punkt')
nltk.download('stopwords')

ps = PorterStemmer()

palabras_clave = []

for row in peliculas.itertuples():
    
    
    text = word_tokenize(row[6]) ## indice de la columna que contiene el texto
    ## Remove stop words
    stops = set(stopwords.words("english"))
    text = [ps.stem(w) for w in text if not w in stops and w.isalnum()]
    text = " ".join(text)
    
    palabras_clave.append(text)

peliculas_preprocessed = peliculas
peliculas_preprocessed['palabras_clave'] = palabras_clave

peliculas_preprocessed

#CREACION Y GUARDADO DE LA BOLSA DE PALABRAS

from sklearn.feature_extraction.text import TfidfVectorizer

bp = TfidfVectorizer()
bp.fit(peliculas_preprocessed['palabras_clave'])
bolsa_palabras= bp.transform(peliculas_preprocessed['palabras_clave'])
print("BoW terminada")
#bolsa_palabras.shape
#print(bolsa_palabras)

bp.get_feature_names()

#PRUEBA DE CARGA DE DATOS: El usuario introduce un título de película y se devuelve la fila correspondiente
#                             - Si no hay película se devuelve un mensaje correspondiente
#                             - Ejemplo posible: "Ariel"

titulo_pelicula = input("Inserta el título de la película ")

pelicula_usuario = peliculas[peliculas["original_title"] == titulo_pelicula]

if pelicula_usuario.empty:
    print("Lo sentimos, pero " + titulo_pelicula + " no está disponible en nuestra base de datos")
else:
    print("La película que has introducido es: " + titulo_pelicula + ". Su información es:")
    print(pelicula_usuario)

#CÁCULO DE DISTANCIAS ENTRE VECTORES DE FRECUENCIAS
# Se crea una matriz n*n donde n es el nº de películas que tenemos y las posiciones i,j de la matriz (fila,columna) indican
# la distancia entre la película en posición i y la película en posición j.
# El motivo de calcularlo en vectores de frecuencia es porque los datos ahora están representados con vectores de frecuencia

from sklearn.metrics import pairwise_distances

matriz_dist = pairwise_distances(bolsa_palabras, bolsa_palabras, metric='euclidean')
#print(matriz_dist.shape)
#print(type(matriz_dist))

"""##Filtrado por sinopsis"""

#BÚSQUEDA DE SIMILARES EN BASE A LA SINOPSIS
# Este trozo de código lo que hace es sacar por pantalla el índice de la
# película insertada por teclado dentro del csv
titulo_base = input("Inserte el título de la película: ")
index_titulo = peliculas_preprocessed[peliculas_preprocessed['original_title'] == titulo_base].index.values[0]

#index_titulo

puntos_dist = list(enumerate(matriz_dist[index_titulo]))

#puntos_dist

pts_ordenados = sorted(puntos_dist, key=lambda x: x[1])
#pts_ordenados

# Ahora por fin podemos sacar los top 3 más similares a la película introducida por el usuario
top_similares = pts_ordenados[1:4]
#top_similares

#Cogemos los índices de esas películas
top_similares_index = [i[0] for i in top_similares]
#top_similares_index

#Y una vez obtenidos los índices, extraemos los títulos correspondientes
print("Las 3 películas más similares a ",titulo_base," son: \n")
peliculas_preprocessed['original_title'].iloc[top_similares_index]

